    const handleSubmit = async () => {
        e.preventDefault()

        console.log(email,password)
    }

    return (
        <form className="login" onSubmit={handleSubmit}>
            <h3>Sign Up</h3>

            <label>Email: </label>
            <input
                type='email'
                onChange={(e)=>setEmail(e.target.value)}
                value={email}
            />

            <input
                type='password'
                onChange={(e)=>setPassword(e.target.value)}
                value={password}
            />

            <button>Log in</button>
        </form>
    )
}

